import { Component, OnInit } from '@angular/core';
import { UserService } from 'src/app/services/user.service';

@Component({
  selector: 'app-all-users',
  templateUrl: './all-users.component.html',
  styleUrls: ['./all-users.component.css']
})
export class AllUsersComponent implements OnInit {


  userList: any[] = [];

  constructor(private userService: UserService) { }

  ngOnInit(): void {
    this.getAllUser();
  }



  getAllUser() {
    this.userService.getAllUser().subscribe((res) => {
      this.userList = res;
      console.log(res);

    })
  }

  deleteUser(username: string) {
    const confirmDelete = confirm("Do you want to delete this user?");
    if (confirmDelete) {
      // Proceed with the deletion logic
      this.userService.deleteUser(username).subscribe(
        (response) => {
          alert("User deleted successfully!");
          this.getAllUser();
        },
        (error) => {
          alert("Failed to delete user.");
        }
      );
    }
  }


}
<app-admin-menu></app-admin-menu>

<!DOCTYPE html>
<html lang="en">
<head>
  <meta charset="UTF-8">
  <meta name="viewport" content="width=device-width, initial-scale=1.0">
  <title>Document</title>
</head>
<body>


<div class="container mt-4">
  <h2 class="text-center page-title">All Users</h2>

  <div class="table-responsive">
    <table class="table table-bordered table-striped table-hover">
      <thead class="table-dark">
        <tr>
          <th>USERNAME</th>
          <th>PASSWORD</th>
          <th>FIRST NAME</th>
          <th>LAST NAME</th>
          <th>EMAIL</th>
          <th>ROLE</th>
          <th>ACTION</th>
        </tr>
      </thead>

      <tbody>
        <tr *ngFor="let user of userList">
          <td>{{ user.username }}</td>
          <td>{{ user.password | hidePassword}}</td>
          <td>{{ user.firstName | titlecase}}</td>
          <td>{{ user.lastName }}</td>
          <td>{{ user.email }}</td>
          <td>{{ user.role }}</td>
          <td>

            <button (click)="deleteUser(user.username)" class="btn btn-danger">Delete</button>
            <a class="btn btn-success" [routerLink]="['/edit-user', user.username]">Edit</a>

          </td>
        </tr>
      </tbody>
    </table>
  </div>
</div>

</body>
</html>
